export default [
    {
      _tag: 'CSidebarNavItem',
      name: 'Dashboard',
      to: '/dashboard',
      icon: 'cil-speedometer',
      badge: {
        color: 'info',
        text: 'NEW',
      }
    },
    {
      _tag: 'CSidebarNavTitle',
      _children: ['Users']
    },
    {
      _tag: 'CSidebarNavItem',
      name: 'Add Users',
      to: '/users/add',
      icon: 'cil-user-follow',
    },
    {
      _tag: 'CSidebarNavItem',
      name: 'Manage Users',
      to: '/users/manage',
      icon: 'cil-pencil',
    },


    {
        _tag: 'CSidebarNavTitle',
        _children: ['Announcements']
      },
      {
        _tag: 'CSidebarNavItem',
        name: 'Add Announcements',
        to: '/announcements/add',
        icon: 'cil-drop',
      },
      {
        _tag: 'CSidebarNavItem',
        name: 'Manage Announcements',
        to: '/announcements/manage',
        icon: 'cil-pencil',
      },

      {
        _tag: 'CSidebarNavTitle',
        _children: ['Posts']
      },
      {
        _tag: 'CSidebarNavItem',
        name: 'Add Post',
        to: '/posts/add',
        icon: 'cil-drop',
      },
      {
        _tag: 'CSidebarNavItem',
        name: 'Manage Posts',
        to: '/posts/manage',
        icon: 'cil-pencil',
      },
    
  ]
